import React from 'react'
import { Line } from "react-chartjs-2";

function Chart() {
    const data = {
        labels: ["1", "2", "3", "4", "5"],
        datasets: [
            {
                label: 'Videos',
                backgroundColor: 'coral',
                data: [4, 5, 1, 10, 6, 12]
            },
            {
                label: 'Subs',
                backgroundColor: 'lightgreen',
                data: [42, 15, 1, 110, 16, 512]
            }
        ]
    }
    return (
        <div>
            <Line data={data}
            />
        </div>
    )
}

export default Chart
